import React, { useState } from 'react';
import InputForm from './components/InputForm.js';
import InputTable from './components/InputTable.js';



function App() {
  let count=0;
  const [data,Setdata]=useState('');

  const DataHandler= (EnteredData) => {

    const Data={
      ...EnteredData,
      id:count+1
    };
    count++;
    console.log(Data);
    Setdata(Data);
  }


  return (
    <div>
      <InputForm DataComing={DataHandler} ></InputForm>
      <InputTable data={data}></InputTable>
    </div>
  );
}

export default App;
